  const location = useLocation();
  const movie = location.movie;
  console.log(movie);
  return (
    <div className="watch">
      <div className="back">
        <ArrowBackOutlined />
        Home
      </div>
      <video
        className="video"
        autoPlay
        progress
        controls
        src={movie.trailer}
      />

    </div>
  );
}
